import React from 'react';
import { Provider } from 'react-redux';
import { store } from './store/store';
import { AppRouter } from './routers/AppRouter';



export const AppDeepDaemon = () => {
    return (

        <Provider store= { store }> 
            <AppRouter />     
        </Provider>
        
        )
}
